import React,{useState} from 'react';
import {Link,Redirect} from 'react-router-dom';
import {Box, Grommet,Button,Heading,Text,Grid} from 'grommet';
import '../App.css';

function Aisub(props) {
    

    return (
        <>
            <Box direction="row-responsive" width="100%" gap="medium" >
                <div className="res">
                <Box justify="center" >
                    <img src={props.image} style={{width:"300px",height:"300px"}}></img>
                </Box>
                </div>
                <div className="res">
                <Box >
                <Heading margin="none" level="2" color="black">{props.head} </Heading>
                <Text color="dark-1" margin={{"top":"2%"}}>{props.text}</Text>
                </Box>
                </div>

            </Box>
        </>
    )
}
export default Aisub;
